import {
  ContainerAnimation,
  ContainerFloor,
  ContainerMain,
  Orbit1,
  WapperAnimation,
} from "./AnimationStyle";
import RootSvg from "./RootSvg";
import Satellite from "./Satellite";

const BoxAnimation = () => {
  return (
    <WapperAnimation>
      <ContainerAnimation>
        <ContainerFloor>
          <ContainerMain>
            <RootSvg />
          </ContainerMain>
          <Orbit1>
            <Satellite index="1"></Satellite>
          </Orbit1>
          <Orbit1>
            <Satellite index="2"></Satellite>
          </Orbit1>
        </ContainerFloor>
      </ContainerAnimation>
    </WapperAnimation>
  );
};
export default BoxAnimation;
